class Solution:
    def minOperations(self, n: int, a: List[int]) -> int:

        def swap(x, y, a, b):
            a[x], a[y] = a[y], a[x]
            b[x], b[y] = b[y], b[x]

        def partition(a, b, idx, n, m, answer):
            if idx >= n:
                return
            if idx == m:
                answer.append(a[idx])
                return

            for i in range(idx, n):
                if a[i] >= b[idx]:
                    swap(i, idx, a, b)
                    partition(a, b, i, n, m, answer)
            return

        m = len(a)
        n = len(b)
        answer = []
        partition(a, b, 0, n, m, answer)
        return len(answer)

