    while i < len(dist):
        if dist[i] >= B:
            break
        i += 1

    # if we have found B, we can now update the minimum number of turns
    if i < len(dist):
        B = dist[i]

    # if we haven't found anything, then B is not an index
    if i < len(dist):
        B = -1

    # if we are not at the last index, then B is not at last index
    if i > len(dist) - 1:
        B = -1

