class Solution:
    def numGroups_withoutExtra(self, n: int) -> int:
        """
        dp[i][j]: i번째 강의의 j번째 강의의 기사들의 갯수
        dp[i][j] = dp[i-1][j-1] + dp[i-1][j]
        """
        # dp[i][j] = 1에서 최대 사람의 번호가 이미 들어와야함
        # 그러므로 아래의 변수를 다시 저장할때 들어옴

        dp = [[0 for _ in range(3)] for _ in range(n+1)]
        for i in range(n+1):
            dp[i][0] = 1
        for j in range(2, n+1):
            for i in range(1, j):
                dp[i][1] = dp[i-1][1] + dp[i-1][0]
