    from itertools import permutations
    def apply(num):
        return num

    def apply(n, n_p):
        n = str(n)
        n_p = list(map(str, n_p))
        return n_p[:n] + [n + '0'] + n_p[n_p.index(n) + 1:] + [n + '1']

    def permute(n):
        if n <= 0:
            return []
        n_p = permute(n-1)
        return [apply(n)] + [permute(n-1) + [i] for i in n_p]

    def solution(n):
        perm = permute(n)
        if len(perm) < 2:
            return 2
        for i in range(2, len(perm) + 1):
            perm.append([])
            perm = perm + permute(i)
        return len(perm)

