class Solution:
    def findSpanningTree(self, nums: List[int]) -> List[int]:
        from collections import defaultdict

        def dfs(i, j):
            if i > j: return False
            if i == j:
                return True
            if i < j:
                return dfs(i + 1, j - 1) or dfs(i + 1, j + 1) or dfs(i + 1, j) or dfs(i + 1, j + 1)

        def check(nums, start, end):
            n = len(nums)
            visited = defaultdict(list)
            visited[start] = [True] * n
            q = collections.deque([start])
            while q:
                for _ in range(len(q)):
                    cur = q.popleft()
                    for i in range(n):
                        if not visited[i] and nums[i] == cur:
                            visited[i] = [True] * n
                            q.append(i)
            return all(visited[cur])

