        self.curr = []
    def add(self, s):
        curr = self.curr[len(self.curr) - 1]
        if curr[-1]!= ".":
            self.curr.append(s)
        else:
            self.curr.append(curr[:-1] + s)
        self.curr[len(self.curr) - 1] = s
    def find(self, num):
        for i in self.curr:
            if num == i[-1]:
                return i
        return False
    def concat(self, s):
        if s[0]!= ".":
            self.add(s)
        else:
            self.curr = []
            for i in s:
                if i == ".":
                    self.curr.append(i)
                else:
                    self.curr.append(self.find(i))
            self.curr = "".join(self.curr)
        return self.curr

